import {
    IonBackButton,
    IonButtons,
    IonContent,
    IonHeader,
    IonPage,
    IonTitle,
    IonToolbar,
  } from "@ionic/react";
import React from "react";
import CardList from "../../components/CardList/CardList";

const Agents:React.FC = () => {
    return (
        <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton />
          </IonButtons>
          <IonTitle>Agents</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <CardList />
      </IonContent>
    </IonPage>
    );
};

export default Agents;
